function Main(){
    
    const AllBooks=[
        {
            title: 'this is a new book',
            author: 'kimbi',
            isbn: 458295,
            year: '12-34-2020'
        },
        {
            title: 'A brief History of time',
            author: 'Stephen Hawkings',
            isbn: 59340450,
            year: '12-34-2020'
        },
        {
            title: 'the theory of quantum relativity',
            author: 'Albert Eistein',
            isbn: 38023783,
            year: '12-34-2020'
        },
        {
            title: 'the theory of quantum relativity',
            author: 'Albert Eistein',
            isbn: 38023783,
            year: '12-34-2020'
        }
    ]
    return(
        <div id ="main">
            <MainPanel />
            <Books />
            <Letter />
        </div>
    )
}

export default Main;
